  async loginInternal(email) {
    await this.inputEmail.setValue(email);
    await this.btnMasuk.click();
  }

  async loginExternal(email, password) {
    await this.inputEmail.setValue(email);
    await browser.pause(2000);
    await this.btnMasuk.click();
    await this.inputPassword.setValue(password);
    await this.btnMasuk.click();
  }

